import React from "react";

export const Header = (props) => {
  return (
    <header id="header">
      <div className="intro">

        <div className="overlay">
          <div className="container">
          <video src="intro-bg.mp4"  type="video/mp4" autoPlay muted loop className="video-background"></video>

          </div>
        </div>
      </div>
    </header>
  );
};
